pragma solidity 0.6.12;

contract Contract {
    address public owner;
    mapping(address => uint256) public invalidorder;
    mapping(address => mapping(address => uint256)) public balanceof;
    mapping(address => bool) public admins;
    mapping(address => uint256) public lastactivetransaction;
    address public feeaccount;
    uint256 public inactivityreleaseperiod;

    function setOwner(address _owner) public {
        owner = _owner;
    }

    function setAdmin(address _admin, bool _value) public {
        admins[_admin] = _value;
    }

    function depositToken(address _token, uint256 _amount) public {
        balanceof[_token][msg.sender] += _amount;
        lastactivetransaction[msg.sender] = block.number;
        // Assuming transferFrom is accessible from the token contract
        _token.call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), _amount));
    }

    function deposit() public payable {
        balanceof[address(0)][msg.sender] += msg.value;
        lastactivetransaction[msg.sender] = block.number;
    }

    function invalidateOrdersBefore(address _user, uint256 _nonce) public {
        require(admins[msg.sender]);
        require(_nonce > invalidorder[_user]);
        invalidorder[_user] = _nonce;
    }

    function setInactivityReleasePeriod(uint256 _period) public {
        require(admins[msg.sender]);
        require(_period < 1000000);
        inactivityreleaseperiod = _period;
    }

    function withdrawToken(address _token, uint256 _amount) public {
        require(block.number - lastactivetransaction[msg.sender] > inactivityreleaseperiod);
        require(balanceof[_token][msg.sender] >= _amount);
        balanceof[_token][msg.sender] -= _amount;
        if (_token == address(0)) {
            msg.sender.call{ value: _amount }("");
        } else {
            _token.call(abi.encodeWithSignature("transfer(address,uint256)", msg.sender, _amount));
        }
    }
}
